INSERT INTO experiment_runs VALUES(1,'Dummy experiment run where the agents take turns',1,replace('run_config:\n  condition:\n    name: palaestrai.experiment:VanillaRunGovernorTerminationCondition\n    params: {}\nschedule:\n- First Phase:\n    agents:\n    - actuators: [myenv.0, myenv.1, myenv.2, myenv.3, myenv.4]\n      brain:\n        name: palaestrai.agent.dummy_brain:DummyBrain\n        params: {}\n      muscle:\n        name: palaestrai.agent.dummy_muscle:DummyMuscle\n        params: {count_upwards: true}\n      name: Agent One\n      objective:\n        name: palaestrai.agent.dummy_objective:DummyObjective\n        params: {params: 1}\n      sensors: [myenv.0, myenv.1, myenv.2, myenv.3, myenv.4]\n    - actuators: [myenv.5, myenv.6, myenv.7, myenv.8, myenv.9]\n      brain:\n        name: palaestrai.agent.dummy_brain:DummyBrain\n        params: {}\n      muscle:\n        name: palaestrai.agent.dummy_muscle:DummyMuscle\n        params: {count_upwards: true}\n      name: Agent Two\n      objective:\n        name: palaestrai.agent.dummy_objective:DummyObjective\n        params: {params: 1}\n      sensors: [myenv.5, myenv.6, myenv.7, myenv.8, myenv.9]\n    environments:\n    - environment:\n        name: palaestrai.environment.dummy_environment:DummyEnvironment\n        params: {discrete: true}\n        uid: myenv\n    phase_config: {episodes: 2, mode: train, worker: 1}\n    simulation:\n      conditions:\n      - name: palaestrai.simulation:VanillaSimControllerTerminationCondition\n        params: {}\n      name: palaestrai.simulation:TakingTurns\n- Second Phase:\n    agents:\n    - actuators: [myenv.0, myenv.1, myenv.2, myenv.3, myenv.4]\n      brain:\n        name: palaestrai.agent.dummy_brain:DummyBrain\n        params: {}\n      muscle:\n        name: palaestrai.agent.dummy_muscle:DummyMuscle\n        params: {count_upwards: true}\n      name: Agent One\n      objective:\n        name: palaestrai.agent.dummy_objective:DummyObjective\n        params: {params: 1}\n      sensors: [myenv.0, myenv.1, myenv.2, myenv.3, myenv.4]\n    - actuators: [myenv.5, myenv.6, myenv.7, myenv.8, myenv.9]\n      brain:\n        name: palaestrai.agent.dummy_brain:DummyBrain\n        params: {}\n      muscle:\n        name: palaestrai.agent.dummy_muscle:DummyMuscle\n        params: {count_upwards: true}\n      name: Agent Two\n      objective:\n        name: palaestrai.agent.dummy_objective:DummyObjective\n        params: {params: 1}\n      sensors: [myenv.5, myenv.6, myenv.7, myenv.8, myenv.9]\n    environments:\n    - environment:\n        name: palaestrai.environment.dummy_environment:DummyEnvironment\n        params: {discrete: true}\n        uid: myenv\n    phase_config: {episodes: 1, mode: test, worker: 1}\n    simulation:\n      conditions:\n      - name: palaestrai.simulation:VanillaSimControllerTerminationCondition\n        params: {}\n      name: palaestrai.simulation:TakingTurns\nseed: 47\nuid: Dummy experiment run where the agents take turns\nversion: 3.5.2','\n',char(10)),'{"uid": "Dummy experiment run where the agents take turns", "seed": 47, "version": "3.5.2", "schedule": [{"First Phase": {"environments": [{"environment": {"name": "palaestrai.environment.dummy_environment:DummyEnvironment", "uid": "myenv", "params": {"discrete": true}}}], "agents": [{"name": "Agent One", "brain": {"name": "palaestrai.agent.dummy_brain:DummyBrain", "params": {}}, "muscle": {"name": "palaestrai.agent.dummy_muscle:DummyMuscle", "params": {"count_upwards": true}}, "objective": {"name": "palaestrai.agent.dummy_objective:DummyObjective", "params": {"params": 1}}, "sensors": ["myenv.0", "myenv.1", "myenv.2", "myenv.3", "myenv.4"], "actuators": ["myenv.0", "myenv.1", "myenv.2", "myenv.3", "myenv.4"]}, {"name": "Agent Two", "brain": {"name": "palaestrai.agent.dummy_brain:DummyBrain", "params": {}}, "muscle": {"name": "palaestrai.agent.dummy_muscle:DummyMuscle", "params": {"count_upwards": true}}, "objective": {"name": "palaestrai.agent.dummy_objective:DummyObjective", "params": {"params": 1}}, "sensors": ["myenv.5", "myenv.6", "myenv.7", "myenv.8", "myenv.9"], "actuators": ["myenv.5", "myenv.6", "myenv.7", "myenv.8", "myenv.9"]}], "simulation": {"name": "palaestrai.simulation:TakingTurns", "conditions": [{"name": "palaestrai.simulation:VanillaSimControllerTerminationCondition", "params": {}}]}, "phase_config": {"mode": "train", "worker": 1, "episodes": 2}}}, {"Second Phase": {"environments": [{"environment": {"name": "palaestrai.environment.dummy_environment:DummyEnvironment", "uid": "myenv", "params": {"discrete": true}}}], "agents": [{"name": "Agent One", "brain": {"name": "palaestrai.agent.dummy_brain:DummyBrain", "params": {}}, "muscle": {"name": "palaestrai.agent.dummy_muscle:DummyMuscle", "params": {"count_upwards": true}}, "objective": {"name": "palaestrai.agent.dummy_objective:DummyObjective", "params": {"params": 1}}, "sensors": ["myenv.0", "myenv.1", "myenv.2", "myenv.3", "myenv.4"], "actuators": ["myenv.0", "myenv.1", "myenv.2", "myenv.3", "myenv.4"]}, {"name": "Agent Two", "brain": {"name": "palaestrai.agent.dummy_brain:DummyBrain", "params": {}}, "muscle": {"name": "palaestrai.agent.dummy_muscle:DummyMuscle", "params": {"count_upwards": true}}, "objective": {"name": "palaestrai.agent.dummy_objective:DummyObjective", "params": {"params": 1}}, "sensors": ["myenv.5", "myenv.6", "myenv.7", "myenv.8", "myenv.9"], "actuators": ["myenv.5", "myenv.6", "myenv.7", "myenv.8", "myenv.9"]}], "simulation": {"name": "palaestrai.simulation:TakingTurns", "conditions": [{"name": "palaestrai.simulation:VanillaSimControllerTerminationCondition", "params": {}}]}, "phase_config": {"mode": "test", "worker": 1, "episodes": 1}}}], "run_config": {"condition": {"name": "palaestrai.experiment:VanillaRunGovernorTerminationCondition", "params": {}}}}','5eee7fc8beac77c58ca974de833faaa662a63c5f310a5997a3ccd6d14af7bec3fa2e1c993daf26692c563ac6738573d31c231239212a41a55f1e419a48cffb27');
